export function ftsify(split_string, min_length = null, max_length = null) {
    if (typeof(split_string) != 'string' || typeof(sprint_string) == null) {
        return;
    }
    var split_string_array = split_string.toLowerCase().split(/\W+/);
    var return_array = new Array();
    for (var i = 0; i < split_string_array.length; ++i) {
        return_array.push(create_substrings(split_string_array[i], min_length, max_length));
    }

    return new Set(return_array.flat());
}

export function create_substrings(_string, min_length, max_length) {
    var i, j, result = [];
    var size = (min_length || 0);
    var max_size = (max_length ?? _string.length);
    for (i = 0; i < _string.length; i++) {
        for (j = _string.length; j - i >= size; j--) {
            if (_string.slice(i, j).length <= max_size) {
                result.push(_string.slice(i, j));
            }
        }
    }
    return result;
}
}}}

